import React, { Component } from 'react'
import { Nav, NavItem, Navbar, } from 'react-bootstrap'

class Header extends Component {

    render() {
        return(
            <div>
                <Navbar>
                    <Navbar.Brand>
                        CEA
                    </Navbar.Brand>
                </Navbar>
            </div>
        )
    }
}

export default Header;
